import React,{Component} from 'react';
import TextField from '@material-ui/core/TextField';
//import {connect} from 'react-redux';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

class AddDeployment extends Component
{
    constructor ()
    {
       super();

       this.state = {
           versionlst : [],
           Url:"",
           TemplateName:"",
           version:""

       }
    }

componentDidMount()
{
   const getVersionUrl = "http://localhost:8000/gettemplates";

    axios.post(getVersionUrl).then((response)=>{
                this.setState({versionlst:response},()=>{
                            console.log(this.state)
                })
                console.log("Response - "+ JSON.stringify(response));
        }).catch(err=>{
              //  console.log("ERR - "+JSON.stringify(err));
        })
}

    render()
    {

        return(
            <div>
                 <TextField label="Url" name="Url" id="Url"/>
                 <FormControl variant="outlined">    
                    <Select name="TemplateName"
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    >
                        {/* {this.props.versionlst.map((item) => <option key={item.Key} value={item.Key}>{item.Value}</option>)} */}
                    </Select>
                </FormControl>
                <FormControl variant="outlined">    
                    <Select name="version"
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    >
                        {/* {this.props.versionlst.map((item) => <option key={item.Key} value={item.Key}>{item.Value}</option>)} */}
                    </Select>
                </FormControl>

                <Button variant="contained" color="primary"> Add Deployment  </Button>
            </div>
        )

    }


}

export default AddDeployment;

